// SPDX-License-Identifier: GPL-3.0;
pragma solidity >=0.7.0 < 0.8.0;

contract Auction {

    address public owner;
    address public highestBidder; // The highest bidder's address
    uint public highestBid; // The amount of the highest bid
    mapping(address => uint) public userBalances; // mapping for the amount to return

    constructor(){
        highestBid = 0;
        owner = msg.sender;
    }

    function bid() public payable{
        address payable Bidder_address = msg.sender;
        uint Bidder_value = msg.value;

        require((Bidder_address != owner) && (Bidder_value > highestBid), "You are the owner or bid is too small.");
        require(Bidder_address.send(userBalances[Bidder_address]), "Failed to send Ether.");

        highestBidder = Bidder_address;
        highestBid = Bidder_value;
        userBalances[Bidder_address] = Bidder_value;
    }

    function withdraw() public payable {
        address payable Bidder_address = msg.sender;
        uint Amount = userBalances[Bidder_address];

        require((userBalances[Bidder_address] > 0) && (highestBidder != Bidder_address), "You need to make a bid first or you are the highest bidder.");
	    require(Bidder_address.send(Amount), "Failed to withdraw.");

	    userBalances[Bidder_address] = 0;
    }

    receive() external payable {
    }
}
